Testimony 5 by Bikini states, "The stabbing I saw must have occurred after she was pushed out of her window." However, Evidence 11, which is "Elise's Autopsy Report," states that the cause of death was from a "stab in the back" and that the "body fell 10 ft. after death." This implies that Elise Deauxnim was stabbed before she was pushed, contradicting Bikini's assertion that the stabbing occurred after she was pushed from the window.

