Testimony 2 by Larry Butz claims, "I saw Iris flying! Her white hood fluttering!" This implies that Iris was seen at or near the Dusky Bridge. However, Evidence 12, "Iris's Testimony," states that she "Rang lights out bell at 10 PM and was then in her room until the murder was discovered." This indicates she claims to have not left her room, contradicting Larry's testimony of seeing her by the bridge.

